;; **
;;; ## Finding contour of headphone and drawing rectangles ...
;; **

;; @@
(def headphones 
  (-> "resources/chapter03/sonyheadphones.jpg"
      (imread IMREAD_REDUCED_COLOR_4)))

(u/mat-view headphones)

;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"629\" height=\"330\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x438e645a \"BufferedImage@438e645a: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1a40145 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 629 height = 330 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def mask
  (-> headphones 
      clone 
      (cvt-color! COLOR_BGR2GRAY)
 	  (threshold! 250 255 THRESH_BINARY)
      (median-blur! 7)))

(u/mat-view mask)

(def masked-input
  (clone headphones))

(set-to masked-input (new-scalar 0 0 0) mask)
(set-to masked-input (new-scalar 255 255 255) (bitwise-not! mask))

(u/mat-view masked-input)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"629\" height=\"330\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1149465 \"BufferedImage@1149465: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1a40145 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 629 height = 330 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def contours 
  (new-arraylist))

(find-contours 
  masked-input
  contours 
  (new-mat) ; mask
  RETR_TREE
  CHAIN_APPROX_NONE)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def exercice-1 (clone headphones))
(doseq [c contours]
    (let [ rect (bounding-rect c)]
      (rectangle
        exercice-1
        (new-point (.x rect) (.y rect))
        (new-point (+ (.width rect) (.x rect)) (+ (.y rect) (.height rect)))
        (color/->scalar "#ccffcc")
        2)))

(u/mat-view exercice-1)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"629\" height=\"330\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x31355c70 \"BufferedImage@31355c70: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1a40145 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 629 height = 330 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def interesting-contours 
  (filter 
    #(and 
       (> (contour-area %) 10000 ) 
       (< (.height (bounding-rect %)) (- (.height headphones) 10))) 
    contours))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;lush-storm/interesting-contours</span>","value":"#'lush-storm/interesting-contours"}
;; <=

;; @@
(def exercice-1 (clone headphones))
(doseq [c interesting-contours]
    (let [ rect (bounding-rect c)]
      (rectangle
        exercice-1
        (new-point (.x rect) (.y rect))
        (new-point (+ (.width rect) (.x rect)) (+ (.y rect) (.height rect)))
        (color/->scalar "#ccffcc")
        2)))

(u/mat-view exercice-1)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"629\" height=\"330\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x64a75547 \"BufferedImage@64a75547: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1a40145 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 629 height = 330 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Using core draw-contours to ... draw the contours
;; **

;; @@
(def exercice-2 (clone headphones))

(doseq [c interesting-contours]
 (let [ rect (bounding-rect c) center (u/center-of-rect rect) ]
   (circle exercice-2
           center
           (u/distance-of-two-points center (.tl rect)) 
           (color/->scalar "#ccffcc") 
           2)))


(u/mat-view exercice-2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"629\" height=\"330\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1ae590a \"BufferedImage@1ae590a: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1a40145 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 629 height = 330 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def exercice-3 (clone headphones))

(dotimes [ci (.size interesting-contours)]
 (draw-contours 
   exercice-3
   interesting-contours 
   ci 
   (color/->scalar "#cc66cc") 
   3))

(u/mat-view exercice-3)
